(1, 'Dịch Vụ Khách Hàng', 'where-does-it-come-from', '<p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Dịch vụ khách hàng của chúng tôi hoạt động 24 giờ mỗi ngày, 7 ngày mỗi tuần. Bạn có thể liên hệ với chúng tôi qua email vtytlienchieu@gmail.com, số điện thoại 0902868716 - 0914043909, hoặc trò chuyện trực tuyến trên trang web của chúng tôi.</span><br></p>', NULL, '<p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">DỊCH VỤ KHÁCH HÀNG CỦA&nbsp;</span></font><span style=\"text-align: left; font-size: 14px;\"><font face=\"Open Sans, Arial, sans-serif\">CỬA HÀNG VẬT TƯ Y TẾ LIÊN CHIỂU</font></span></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">Chào mừng bạn đến với Dịch vụ Khách hàng của Vật Tư Y Tế Liên Chiểu! Chúng tôi luôn nỗ lực không ngừng để đảm bảo rằng bạn nhận được sự hỗ trợ tốt nhất từ chúng tôi. Dưới đây là những dịch vụ chính mà chúng tôi cung cấp:</span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">1. **Hỗ trợ 24/7**: Dịch vụ khách hàng của chúng tôi hoạt động 24 giờ mỗi ngày, 7 ngày mỗi tuần. Bạn có thể liên hệ với chúng tôi qua email vtytlienchieu@gmail.com, số điện thoại 0902868716 - 0914043909, hoặc trò chuyện trực tuyến trên trang web của chúng tôi.</span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">2. **Hỗ trợ sản phẩm**: Nếu bạn gặp vấn đề với sản phẩm hoặc dịch vụ của chúng tôi, đội ngũ chuyên gia của chúng tôi sẽ giúp bạn giải quyết nhanh chóng.</span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">3. **Hướng dẫn sử dụng sản phẩm**: Chúng tôi cung cấp hướng dẫn chi tiết về cách sử dụng và bảo dưỡng sản phẩm của chúng tôi.</span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">4. **Phản hồi khách hàng**: Chúng tôi luôn mong muốn nghe ý kiến phản hồi từ khách hàng để cải thiện dịch vụ của mình. Nếu bạn có bất kỳ ý kiến phản hồi nào, xin vui lòng gửi cho chúng tôi.</span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">5. **Giải quyết khiếu nại**: Nếu bạn không hài lòng với sản phẩm hoặc dịch vụ của chúng tôi, hãy liên hệ với chúng tôi. Chúng tôi cam kết giải quyết mọi khiếu nại một cách công bằng và kịp thời.</span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">Chúng tôi rất trân trọng sự ủng hộ của bạn và cam kết mang đến cho bạn dịch vụ khách hàng tốt nhất.</span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">Trân trọng!</span></font></p><p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">Vật Tư Y Tế Liên Chiểu</span></font><br></p><div style=\"text-align: justify;\"><br></div>', '/storage/photos/1/Blog/blog1.jpg', 'Tag,Vật tư y tế,Thiết bị,Liên Hệ', 13, NULL, 1, 'active', '2020-08-14 01:55:55', '2023-12-12 03:44:25'),
(2, 'Điều khoản và điều kiện', 'where-can-i-get-some', '<h2 style=\"text-align: center; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-family: DauphinPlain; font-size: 24px; line-height: 24px;\"><span style=\"font-family: Nunito, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px;\">Chào mừng bạn đến với Vật Tư Y Tế Liên Chiểu! Khi sử dụng dịch vụ của chúng tôi, bạn đồng ý tuân thủ các điều khoản và điều kiện sau đây.</span><br></h2>', NULL, '<p>CHÍNH SÁCH ĐIỀU KHOẢN VÀ DỊCH VỤ CỦA&nbsp;VẬT TƯ Y TẾ LIÊN CHIỂU</p><p><span style=\"font-size: 1rem;\">1. **Giới thiệu**</span></p><p>Chào mừng bạn đến với Vật Tư Y Tế Liên Chiểu! Khi sử dụng dịch vụ của chúng tôi, bạn đồng ý tuân thủ các điều khoản và điều kiện sau đây.</p><p><br></p><p>2. **Dịch vụ**</p><p>Vật Tư Y Tế Liên Chiểu cung cấp, mua bán và cho thuê các trang thiết bị phục vụ chăm sóc sức khỏe. Chúng tôi có quyền thay đổi hoặc ngừng cung cấp dịch vụ bất kỳ lúc nào mà không cần thông báo trước.</p><p><br></p><p>3. **Đăng ký và tài khoản**</p><p>Để sử dụng dịch vụ của chúng tôi, bạn có thể cần đăng ký tài khoản. Bạn phải cung cấp thông tin chính xác và hoàn chỉnh và cập nhật thông tin này khi cần thiết.</p><p><br></p><p>4. **Quyền riêng tư**</p><p>Chúng tôi tôn trọng quyền riêng tư của bạn. Chính sách Bảo mật của chúng tôi giải thích cách chúng tôi thu thập và sử dụng thông tin cá nhân của bạn.</p><p><br></p><p>5. **Hạn chế sử dụng**</p><p>Bạn không được phép sử dụng dịch vụ của chúng tôi để thực hiện các hành vi bất hợp pháp, lừa dối, gây hại hoặc quấy rối người khác.</p><p><br></p><p>6. **Giới hạn trách nhiệm**</p><p>[Tên công ty] không chịu trách nhiệm cho bất kỳ thiệt hại nào phát sinh từ việc sử dụng dịch vụ của chúng tôi.</p><p><br></p><p>7. **Thay đổi Điều khoản và Dịch vụ**</p><p>Chúng tôi có quyền thay đổi Điều khoản và Dịch vụ này bất kỳ lúc nào. Bất kỳ thay đổi nào sẽ có hiệu lực ngay khi được đăng trên trang web của chúng tôi.</p><p><br></p><p>8. **Liên hệ**</p><p>Nếu bạn có bất kỳ câu hỏi hoặc cần thêm thông tin, xin vui lòng liên hệ với chúng tôi qua email vtytlienchieu@gmail.com hoặc số điện thoại 0902868716 - 0914043909.</p><p><br></p><p>Trân trọng!</p><p>Vật Tư Y Tế Liên Chiểu</p><div><br></div>', '/storage/photos/1/Blog/dieukhoan-dichvu.jpg', 'Tag,Vật tư y tế,Thiết bị,Liên Hệ', 12, NULL, 1, 'active', '2020-08-14 01:58:52', '2023-12-12 03:44:13'),
(3, 'Chính sách thuê trả', 'the-standard-lorem-ipsum-passage-used-since-the-1500s', '<p><span style=\"font-size: 1rem;\">Vật Tư Y Tế Liên Chiểu</span>&nbsp;cam kết mang đến cho khách hàng dịch vụ thuê - trả minh bạch, rõ ràng và tiện lợi.<br></p>', NULL, '<p>CHÍNH SÁCH THUÊ - TRẢ CỦA CỬA HÀNG VẬT TƯ Y TẾ LIÊN CHIỂU</p><p><br></p><p><span style=\"font-size: 1rem;\">Vật Tư Y Tế Liên Chiểu</span>&nbsp;cam kết mang đến cho khách hàng dịch vụ thuê - trả minh bạch, rõ ràng và tiện lợi. Dưới đây là các điều khoản và điều kiện của Chính sách Thuê - Trả của chúng tôi:</p><p><br></p><p>1. **Thời gian thuê**: Thời gian thuê tối thiểu và tối đa cho mỗi sản phẩm sẽ được ghi rõ trong mô tả sản phẩm.</p><p><br></p><p>2. **Phí thuê**: Phí thuê cho mỗi sản phẩm sẽ được ghi rõ trên trang web của chúng tôi và không bao gồm phí vận chuyển hoặc bất kỳ phí phụ thu nào khác.</p><p><br></p><p>3. **Đặt cọc**: Khách hàng có thể phải đặt cọc khi thuê một số sản phẩm. Khoản cọc này sẽ được hoàn trả khi sản phẩm được trả lại trong tình trạng tốt.</p><p><br></p><p>4. **Trả hàng**: Sản phẩm thuê phải được trả lại trong tình trạng tốt, không bị hư hỏng hoặc mất mát. Nếu không, chúng tôi có quyền giữ lại khoản cọc và/hoặc tính phí để bù đắp cho sự hư hỏng hoặc mất mát.</p><p><br></p><p>5. **Hủy đơn hàng**: Nếu khách hàng muốn hủy đơn hàng, hãy liên hệ với chúng tôi ít nhất 01 ngày trước ngày thuê. Nếu hủy sau thời gian này, chúng tôi có thể tính phí hủy bỏ.</p><p><br></p><p>6. **Thanh toán**: Chúng tôi chấp nhận nhiều hình thức thanh toán bao gồm thẻ tín dụng, chuyển khoản ngân hàng, và thanh toán trực tiếp tại cửa hàng.</p><p><br></p><p>Nếu bạn có bất kỳ câu hỏi hoặc cần thêm thông tin, xin vui lòng liên hệ với chúng tôi qua email vtytlienchieu@gmail.com hoặc số điện thoại 0902868716 - 0914043909. Chúng tôi luôn sẵn lòng giúp đỡ!</p><p><br></p><p>Trân trọng!</p><p>Vật Tư Y Tế Liên Chiểu</p>', '/storage/photos/1/Blog/thuetra.jpg', 'Tag,Vật tư y tế,Thiết bị,Liên Hệ', 9, NULL, 1, 'active', '2020-08-14 02:59:33', '2023-12-12 03:23:16'),
(5, 'Chính sách đổi trả', 'the-standard-lorem-ipsum-passage', '<p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Nếu bạn không hoàn toàn hài lòng với sản phẩm đã mua, hãy tham khảo Chính sách Đổi trả của chúng tôi.</span><br></p>', NULL, '<p style=\"text-align: justify; \"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">CHÍNH SÁCH ĐỔI TRẢ CỦA CỬA HÀNG VẬT TƯ Y TẾ LIÊN CHIỂU</span></font></p><p><font face=\"Open Sans, Arial, sans-serif\" style=\"text-align: justify; font-size: 1rem;\"><span style=\"font-size: 14px;\">Chúng tôi luôn mong muốn mang lại sự hài lòng cho khách hàng khi mua sắm tại&nbsp;</span></font><span style=\"text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Vật Tư Y Tế Liên Chiểu</span><font face=\"Open Sans, Arial, sans-serif\" style=\"text-align: justify; font-size: 1rem;\"><span style=\"font-size: 14px;\">. Nếu bạn không hoàn toàn hài lòng với sản phẩm đã mua, hãy tham khảo Chính sách Đổi trả của chúng tôi dưới đây:</span></font><br></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">1. **Thời gian đổi trả**: Khách hàng có quyền đổi hoặc trả lại sản phẩm trong vòng 02 ngày kể từ ngày nhận hàng.</span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">2. **Điều kiện đổi trả**: Sản phẩm cần đổi/trả phải còn nguyên vẹn, không bị hư hỏng hoặc thay đổi, và phải còn nguyên tem, nhãn và bao bì gốc.</span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">3. **Quy trình đổi trả**: Để bắt đầu quy trình đổi trả, vui lòng liên hệ với bộ phận chăm sóc khách hàng của chúng tôi qua email: vtytliechieu@gmail.com hoặc số điện thoại 0902868716 - 0914043909.</span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">4. **Phí đổi trả**: Khách hàng và&nbsp;</span></font><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Vật Tư Y Tế Liên Chiểu sẽ có mức thỏa thuận riêng nếu tình trạng sản phẩm vượt quá ngưỡng cho phép</span><span style=\"font-size: 14px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;\">.</span></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">5. **Hoàn tiền**: Khi nhận được và kiểm tra sản phẩm đổi/trả, chúng tôi sẽ xử lý hoàn tiền trong vòng 01 ngày làm việc.</span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">Chúng tôi rất trân trọng sự ủng hộ của bạn và cam kết làm tất cả những gì có thể để đảm bảo bạn hài lòng với mua sắm tại&nbsp;</span></font><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Vật Tư Y Tế Liên Chiểu</span><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">.</span></font></p><p style=\"text-align: justify;\"><span style=\"font-size: 14px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;\">Trân trọng,</span><br></p><p style=\"text-align: justify;\"><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Vật Tư Y Tế Liên Chiểu</span><br></p><div style=\"text-align: justify;\"><br></div>', '/storage/photos/1/Blog/blog2.jpg', 'Tag,Vật tư y tế,Thiết bị,Liên Hệ', 8, NULL, 1, 'active', '2020-08-15 06:58:45', '2023-12-12 03:11:06'),
(6, 'Liên hệ', 'lorem-ipsum-is-simply', '<p style=\"text-align: center;\"><span style=\"font-size: 14px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;\">Nếu Quý khách có bất kỳ câu hỏi hoặc cần thêm thông tin, xin vui lòng liên hệ với chúng tôi qua email hoặc số điện thoại dưới đây. Chúng tôi luôn sẵn lòng giúp đỡ!</span></p>', '<h2 style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-family: DauphinPlain; font-size: 24px; line-height: 24px;\"><br></h2>', '<p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">Kính gửi Quý khách hàng!</span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">Cửa hàng Vật Tư Y Tế Liên Chiểu chúng tôi rất trân trọng sự quan tâm và ủng hộ của Quý khách dành cho sản phẩm/dịch vụ của chúng tôi.</span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">Chúng tôi muốn thông báo về một số cập nhật mới/ưu đãi đặc biệt mà chúng tôi tin rằng sẽ hấp dẫn và hữu ích cho Quý khách.</span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: justify;\"><br></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\">Nếu Quý khách có bất kỳ câu hỏi hoặc cần thêm thông tin, xin vui lòng liên hệ với chúng tôi qua email hoặc số điện thoại dưới đây. Chúng tôi luôn sẵn lòng giúp đỡ!</span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><span style=\"font-weight: bolder;\"><br></span></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><span style=\"font-weight: bolder;\">Trân trọng,</span></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><span style=\"font-weight: bolder;\">Cửa hàng Vật Tư Y Tế Liên Chiểu</span></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><span style=\"font-weight: bolder;\">208 Âu Cơ - Liên Chiểu - Đà Nẵng - Việt Nam</span></span></font></p><p style=\"text-align: justify;\"><font face=\"Open Sans, Arial, sans-serif\"><span style=\"font-size: 14px;\"><span style=\"font-weight: bolder;\">vtytlienchieu@gmail.com</span></span></font></p><p style=\"text-align: justify;\"><a href=\"tel:123456789\" style=\"box-sizing: inherit; color: rgb(247, 148, 29); background-color: rgb(34, 34, 34); padding: 0px; margin: 0px; touch-action: manipulation; font-weight: 600; transition: all 0.4s ease 0s; font-size: 20px; font-family: Poppins, sans-serif; text-align: left;\">+84 902 868 716 - +84 914 043 909</a></p>', '/storage/photos/1/Blog/blog3.jpg', 'Tag,Vật tư y tế,Thiết bị,Liên Hệ', 11, NULL, 1, 'active', '2020-08-17 20:54:19', '2023-12-12 03:14:54');

