(11, 'Máy Đo Huyết Áp Cổ Tay HEM-6161', 'may-do-huyet-ap-co-tay-hem-6161', '<p><span style=\"font-family: Barlow, sans-serif; font-size: 21px;\">HEM-6161 giúp dễ dàng theo dõi huyết áp khi phải thường xuyên di chuyển. Model cơ bản này với hướng dẫn quấn vòng bít và phát hiện nhịp tim không đều để đảm bảo máy đo được sử dụng chính xác.</span><br></p>', NULL, '/storage/photos/1/Products/HEM-6161.jpg', 50, '', 'new', 'active', 920000, 2, 1, 12, 15, 8, '2023-12-02 08:14:54', '2023-12-11 08:34:35'),
(12, 'Máy Đo Huyết Áp Cổ Tay HEM-6181', 'may-do-huyet-ap-co-tay-hem-6181', '<p><span style=\"font-family: Barlow, sans-serif; font-size: 21px;\">Đo huyết áp phong cách với HEM-6181. Cảm biến hướng dẫn tư thế đo tiên tiến của sản phẩm và hướng dẫn quấn vòng bít \"Intelliwrap\" giúp người đo huyết áp dễ dàng sử dụng BẤT CỨ NƠI NÀO ở mức độ chính xác rất cao.</span><br></p>', NULL, '/storage/photos/1/Products/HEM-6181.jpg', 50, '', 'new', 'active', 1310000, 2, 1, 12, 15, 8, '2023-12-02 08:15:58', '2023-12-11 08:34:15'),
(13, 'Ghế massage Shiatsu Beurer MC3800', 'ghe-massage-shiatsu-beurer-mc3800', '<p style=\"margin-bottom: 1.3em; font-size: 13px; font-family: sans-serif;\"><span style=\"font-size: 14.4px;\"><span style=\"font-weight: bolder;\"><em>Ghế massage Shiatsu&nbsp;<a href=\"https://www.beurer.vn/\" style=\"touch-action: manipulation; color: var(--fs-experimental-link-color);\">Beurer</a>&nbsp;MC3800</em>&nbsp;</span>Có ba chương trình mát xa tự động: Relax, Health &amp; Therapy (Thư giãn, Nâng cao sức khỏe và Trị liệu). Các chương trình này tự động mát xa toàn bộ lưng của bạn với sự kết hợp nhịp nhàng của các động tác mát xa lăn, xoa bóp, bấm huyệt….</span></p><p style=\"margin-bottom: 1.3em; font-size: 13px; font-family: sans-serif;\">Bảo hành: 2 năm</p>', NULL, '/storage/photos/1/Products/BR-MC-3800-600x600.jpg', 5, '', 'new', 'active', 24500000, 1, 1, 14, 19, 9, '2023-12-02 08:17:20', '2023-12-11 04:14:00'),
(14, 'Bóng đèn hồng ngoại Philips 150W', 'bong-den-hong-ngoai-philips-150w', '<p style=\"margin-bottom: 1.3em; font-size: 13px; font-family: sans-serif;\"><span style=\"font-weight: bolder;\">Bóng</span>&nbsp;đèn hồng ngoại&nbsp;<span style=\"font-weight: bolder;\">trị liệu&nbsp;</span>Philip 150W có hơi nóng hỗ trợ làm lành, đồng thời kích thích sự lưu thông máu trong cơ thể</p><p style=\"margin-bottom: 1.3em; font-size: 13px; font-family: sans-serif;\">–&nbsp;<span style=\"font-weight: bolder;\">Bóng</span>&nbsp;đèn hồng ngoại&nbsp;<span style=\"font-weight: bolder;\">trị liệu&nbsp;</span>Công suất 150W</p><p style=\"margin-bottom: 1.3em; font-size: 13px; font-family: sans-serif;\">– Đui đèn: Đui xoáy</p><p style=\"margin-bottom: 1.3em; font-size: 13px; font-family: sans-serif;\">– Hàng đạt tiêu chuẩn chất lượng Châu Âu.</p>', NULL, '/storage/photos/1/Products/Bong-den-hong-ngoai-Philip-150W-900x901.jpg', 50, '', 'new', 'active', 420000, 0, 1, 13, NULL, 7, '2023-12-02 08:18:39', '2023-12-11 04:13:38'),
(15, 'BÔNG GẠC ĐẮP VẾT THƯƠNG Y TẾ 10X20CM An Phát', 'bong-gac-dap-vet-thuong-y-te-10x20cm-an-phat', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, 文泉驛正黑, &quot;WenQuanYi Zen Hei&quot;, &quot;Hiragino Sans GB&quot;, &quot;儷黑 Pro&quot;, &quot;LiHei Pro&quot;, &quot;Heiti TC&quot;, 微軟正黑體, &quot;Microsoft JhengHei UI&quot;, &quot;Microsoft JhengHei&quot;, sans-serif; font-size: 14px; white-space-collapse: preserve;\">***Đặc điểm:\r\n- Quy cách: 10 miếng/bì.\r\n- Kích thước: 10x20cm\r\n- Bông gạc đắp vết thương bao gồm: 1 lớp bông được bọc ngoài bởi 1 lớp gạc hoặc vải không dệt.\r\n- Tiệt trùng bởi khí Ethylene Oxide\r\n- Khả năng thấm hút cao và nhanh.\r\n- Mịn màng, mềm mại, không gây kích ứng da.\r\n- Thích hợp khi được dùng để thay băng thường xuyên.\r\n***Tính năng:\r\nBông gạc đắp vết thương được sử dụng rộng rãi tại các bệnh viện, trung tâm y tế và phòng khám.\r\nSử dụng cho nhiều loại vết thương khác nhau: trày xước, vết rách, vết bỏng, vết thương sau phẫu thuật và vết loét, v.v.\r\nĐược dùng để thấm máu và dịch tiết trực tiếp từ vết thương, hoặc để băng bó vết thương sau khi sát trùng.\r\n- Hãng sản xuất: An Phát\r\n- Xuất xứ : Việt Nam</span><br></p>', NULL, '/storage/photos/1/Products/vat-tu/gat10x20anphat.jpg', 1000, '', 'new', 'active', 20000, 0, 1, 21, 23, 10, '2023-12-02 08:21:59', '2023-12-11 03:37:16'),
